# Closest Room
# https://leetcode.com/problems/closest-room/description/
# ROOMS: [room_id, size]
# QUERIES: [preferred_room, min_size]

from bisect import bisect
from sortedcontainers import SortedList

class Solution:
    # Binary search
    def closestRoom(self, rooms: list[list[int]], queries: list[list[int]]) -> list[int]:
        output = [-1] * len(queries)
        availableRooms = SortedList()

        roomsSortedBySize = sorted(rooms, key=lambda x: x[1], reverse=True)

        # [y = min_size, x = preferred_room, i = index]
        queriesSortedBySize = sorted([(y, x, i) for i, (x,y) in enumerate(queries)], reverse=True)

        totalRooms = len(roomsSortedBySize)
        totalQueries = len(queriesSortedBySize)

        roomsPointer, queriesPointer = 0, 0

        while roomsPointer <= totalRooms and queriesPointer < totalQueries:
            #                                Room size                             Min size
            if roomsPointer < totalRooms and roomsSortedBySize[roomsPointer][1] >= queriesSortedBySize[queriesPointer][0]:
                availableRooms.add(roomsSortedBySize[roomsPointer][0])
                roomsPointer += 1

            else:
                if len(availableRooms):
                    preferred, index = queriesSortedBySize[queriesPointer][1], queriesSortedBySize[queriesPointer][2]
                    i = bisect(availableRooms, preferred)

                    candidates = []
                    if i > 0: candidates.append(availableRooms[i-1])
                    if i < len(availableRooms): candidates.append(availableRooms[i])

                    output[index] = min(candidates, key = lambda x: abs(x - preferred))

                queriesPointer += 1

        return output


        # Slow and inefficient brute force method
